function PlayerPosition(props) {
    const playerPositionData = props.data
    console.log(playerPositionData)
    return (
        <>
            <div className="text-lg font-medium leading-snug">Player Position</div>
            <div className="text-sm leading-snug text-[#6d6a7f]">{playerPositionData?.playerInformation?.[1]?.title}</div>
        </>
    )   
}

export default PlayerPosition
